    }
  }


.suscripcion {
    height: 100%;
    background: #11e6f4;
    display: flex;
    flex-direction: row;
    justify-content: space-between;
    & .suscripcionImagen {
        background-color: #11e6f4;
    		display: flex;
    		justify-content: center;
 				align-items: center;
        width: 423;
    		height: 485;
    }
    & .suscripcionInfo {
        display: flex;
        flex-direction: column;
        justify-content: center;
        align-items: center;        
        width: 50%;
        & h1 {
            font-style: normal;
            font-weight: bold;
            font-size: 64px;
            line-height: 106.8%;
            text-align: left;
            color: #DFE2EF;
            padding: 0 0 44px;
        }
        & h2 {
        font-size: 2.5 rem;
    		font: 'Poppins';
    		color: #ffffff;
    		font-weight: bold;
    }
     		& h4 {
         color: #white;
    }
        & h6 {
         font: 'Roboto';
    		    }
        & p {
            font-style: normal;
            font-weight: normal;
            font-size: 17px;
            line-height: 132.4%;
            text-align: left;
            color: white;
            width: 570px;
            padding: 0 0 68px;
        }
        & .suscripcionField {
            display: flex;
            flex-direction: row;
            gap: 30px;
            padding: 0 0 125px;
            & button {
                width: 175px;
                background: #2c2c2c;
                border-radius: 5px;
                font-style: normal;
                font-weight: normal;
                font-size: 17px;
                line-height: 132.4%;
                text-align: center;
                text-transform: none;
                color: white;
            }
            & > div { //Field
                margin-top: 0;
                margin-bottom: 0;
                background: white;
                & label[class*="focused"] {color: #5B321F;}
                & div  {
                    border-top-left-radius: unset;
                    border-top-right-radius: unset;
                    &::before {border-bottom: unset;}
                    &::after {border-bottom: unset;}
                    &:hover {border-bottom: unset;}
                }
            }
        }
    }
}
